    }

    private async Task EditAuthor()
    {
        int id = int.Parse(this.Id);
        bool isSuccess = await _authRepo.Update(Endpoints.AuthorsEndpoint, Model, id);
        if (isSuccess)
        {
            BacktoList();
        } else
        {
            IsFailed = true;
        }

